import "./App.css";
import {BrowserRouter, Route, Switch} from "react-rout"

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path="/login">
            <Login />
          </Route>
          <Main />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
